window.bookSummaryJSON = "<b>“In Britney Spears’s memoir, she’s stronger than ever.” —<i>The</i> <i>New York Times</i></b><br> <br><b><i>The Woman in Me</i> is a brave and astonishingly moving story about freedom, fame, motherhood, survival, faith, and hope.</b><br><br>In June 2021, the whole world was listening as Britney Spears spoke in open court. The impact of sharing her voice—her truth—was undeniable, and it changed the course of her life and the lives of countless others.<i> The Woman in Me</i> reveals for the first time her incredible journey—and the strength at the core of one of the greatest performers in pop music history.<br> <br>Written with remarkable candor and humor, Spears’s groundbreaking book illuminates the enduring power of music and love—and the importance of a woman telling her own story, on her own terms, at last."; 
